styles:
.dc-progress-outer {
  min-width: 150px;
  height: 15px;
  display: flex;
  flex-direction: row;
}

.dc-progress-inner {
  background-color: #e5f0f7;
  position: relative;
  flex: 1;
}

.dc-progress-bar {
  height: 100%;
  background: url("data:image/png;base64,") repeat-x transparent;
}

.dc-progress-text {
  width: 60px;
  line-height: 15px;
  text-align: center;
  color: #0081cc;
  font-size: 12px;
}
